  false,\n\t\"url\": null,\n\t\"notes\": \"The TIGER/Line Files are shapefiles and
  related database files (.dbf) that are an extract of selected geographic and cartographic
  information from the U.S. Census Bureau's Master Address File / Topologically Integrated
  Geographic Encoding and Referencing (MAF/TIGER) Database (MTDB).  The MTDB represents
  a seamless national file with no overlaps or gaps between parts, however, each TIGER/Line
  File is designed to stand alone as an independent data set, or they can be combined
  to cover the entire nation.  Edge refers to the linear topological primitives that
  make up MTDB.  The All Lines Shapefile contains linear features such as roads, railroads,
  and hydrography.  Additional attribute data associated with the linear features
  found in the All Lines Shapefile are available in relationship (.dbf) files that
  users must download separately.  The All Lines Shapefile contains the geometry and
  attributes of each topological primitive edge.  Each edge has a unique TIGER/Line
  identifier (TLID) value.  n\",\n\t\"owner_org\": \"c64722ff-641a-4ddd-bbb8-4bd9fd2e7963\",\n\t\"extras\":
